### Summary of Core Topics, Concepts, Principles, and Equations

#### 1. **Probability Distributions**
   - **Discrete Random Variables:**
     - **Uniform Distribution (Discrete):** \( P(X = k) = \frac{1}{n} \), \( E[X] = \frac{a+b}{2} \), \( Var(X) = \frac{n^2-1}{12} \)
     - **Bernoulli Distribution:** \( P(X = k) = p^k (1-p)^{1-k} \), \( E[X] = p \), \( Var(X) = p(1-p) \)
     - **Binomial Distribution:** \( P(X = k) = ^nC_k p^k (1-p)^{n-k} \), \( E[X] = np \), \( Var(X) = np(1-p) \)
     - **Geometric Distribution:** \( P(X = k) = (1-p)^{k-1} p \), \( E[X] = \frac{1}{p} \), \( Var(X) = \frac{1-p}{p^2} \)
     - **Poisson Distribution:** \( P(X = k) = \frac{e^{-\lambda} \lambda^k}{k!} \), \( E[X] = \lambda \), \( Var(X) = \lambda \)

   - **Continuous Random Variables:**
     - **Uniform Distribution (Continuous):** \( f_X(x) = \frac{1}{b-a} \), \( E[X] = \frac{a+b}{2} \), \( Var(X) = \frac{(b-a)^2}{12} \)
     - **Exponential Distribution:** \( f_X(x) = \lambda e^{-\lambda x} \), \( E[X] = \frac{1}{\lambda} \), \( Var(X) = \frac{1}{\lambda^2} \)
     - **Normal Distribution:** \( f_X(x) = \frac{1}{\sigma \sqrt{2\pi}} \exp \left( \frac{-(x-\mu)^2}{2\sigma^2} \right) \), \( E[X] = \mu \), \( Var(X) = \sigma^2 \)
     - **Gamma Distribution:** \( f_X(x) = \frac{\beta^\alpha}{\Gamma(\alpha)} x^{\alpha-1} e^{-\beta x} \), \( E[X] = \frac{\alpha}{\beta} \), \( Var(X) = \frac{\alpha}{\beta^2} \)
     - **Beta Distribution:** \( f_X(x) = \frac{\Gamma(\alpha + \beta)}{\Gamma(\alpha) \Gamma(\beta)} x^{\alpha-1} (1-x)^{\beta-1} \), \( E[X] = \frac{\alpha}{\alpha + \beta} \), \( Var(X) = \frac{\alpha \beta}{(\alpha + \beta)^2 (\alpha + \beta + 1)} \)

#### 2. **Inequalities and Theorems**
   - **Markov’s Inequality:** \( P(X \geq c) \leq \frac{\mu}{c} \)
   - **Chebyshev’s Inequality:** \( P(|X - \mu| \geq k\sigma) \leq \frac{1}{k^2} \)
   - **Weak Law of Large Numbers:** \( P(|\overline{X} - \mu| > \delta) \leq \frac{\sigma^2}{n\delta^2} \)
   - **Central Limit Theorem (CLT):** \( \frac{Y - n\mu}{\sqrt{n\sigma}} \approx \text{Normal}(0, 1) \)

#### 3. **Joint Distributions and Independence**
   - **Joint PMF/PDF:** \( f_{XY}(x, y) \)
   - **Marginal PMF/PDF:** \( f_X(x) = \sum_y f_{XY}(x, y) \) (discrete), \( f_X(x) = \int_y f_{XY}(x, y) dy \) (continuous)
   - **Independence:** \( X \) and \( Y \) are independent if \( f_{XY}(x, y) = f_X(x) f_Y(y) \)

#### 4. **Moment Generating Functions (MGF)**
   - **MGF Definition:** \( M_X(t) = E[e^{tX}] \)
   - **MGF of Bernoulli:** \( M_X(t) = 1 - p + pe^t \)

#### 5. **Sample Mean and Variance**
   - **Expected Value of Sample Mean:** \( E[\overline{X}] = \mu \)
   - **Variance of Sample Mean:** \( Var(\overline{X}) = \frac{\sigma^2}{n} \)

#### 6. **Conditional Probability and Expectation**
   - **Conditional PDF:** \( f_{Y|X}(y|x) = \frac{f_{XY}(x, y)}{f_X(x)} \)
   - **Conditional Expectation:** \( E[Y|X] \)

